import "./App.css";
import { useState } from "react";
import { useEffect } from "react";
import axios from "axios";
import Select from "react-select";
import Loader from "./components/Loader";

function App() {
  const [imgPreview, setImage] = useState(
    "https://dealerinspire-image-library-prod.s3.us-east-1.amazonaws.com/images/MYIfHUlc4kMT9zdswcVse9OHz0YAB0DHbVEmNV3W.jpg"
  );
  const [img64, setImage64] = useState(
    ""
  );
  const [filtersIsActive, setActivateFilters] = useState(false);
  const [loader, setLoader] = useState(false);
  const [imgId, setImgId] = useState(null);
  const [newImg64, setNewImg64] = useState(
    ""
  );
  const [confidence, setConfidence] = useState(0.5);
  const [labelSearch, setLabelSearch] = useState("");
  const [labels, setLabels] = useState([]);
  const [foundMsg, setFoundMsg] = useState("");

  const onImageChange = (event) => {
    if (event.target.files && event.target.files[0]) {
      console.log(event);
      setImage(URL.createObjectURL(event.target.files[0]));

      var reader = new FileReader();
      reader.readAsDataURL(event.target.files[0]);

      reader.onload = () => {
        setImage64(reader.result);
      };
      reader.onerror = (error) => {
        console.log("Error: ", error);
      };
    }
  };
  const onClickProcess = async () => {
    let regex = /^data:image\/[^;]+;base64,/;
    let base64Data = img64.replace(regex, "");
    setActivateFilters(false);
    setLoader(true);
    try {
      var response = await axios.post("http://10.5.0.10:8000/api/v1/images/", {
        image_base_64: base64Data,
      });

      if (response.status === 200) {
        setImgId(response.data.id);
        response = await axios.get(
          `http://10.5.0.10:8000/api/v1/boxes/${response.data.id}`,
          {
            params: {
              label: labelSearch,
              confidence: confidence,
            },
          }
        );
        if (response.status === 200) {
          setNewImg64(response.data.new_image_base_64);
        }
        setLoader(false);
        setActivateFilters(true);
      }
    } catch (error) {
      console.log(error);
    }
  };
  const onClickFilter = () => {
    setLoader(true);
    setFoundMsg("");
    axios
      .get(`http://10.5.0.10:8000/api/v1/boxes/${imgId}`, {
        params: {
          label: labelSearch.value,
          confidence: confidence,
        },
      })
      .then((response) => {
        if (response.status === 200) {
          setNewImg64(response.data.new_image_base_64);
        }
        setLoader(false);
      })
      .catch(() => {
        let regex = /^data:image\/[^;]+;base64,/;
        let base64Data = img64.replace(regex, "");
        setLoader(false);
        setNewImg64(base64Data);
        setFoundMsg(`No ${labelSearch.value} found`);
      });
  };
  useEffect(() => {
    async function fetchData() {
      var response = await axios.get("http://10.5.0.10:8000/api/v1/classes/");
      if (response.status === 200) {
        setLabels(
          response.data.map((x) => {
            return { value: x, label: x };
          })
        );
      }
    }
    fetchData();
  }, []);
  return (
    <div className="wrapper font-vietnam flex flex-col ">
      <h1 className="text-6xl font-semibold mt-12 text-center text-dark-blue">
        Object Detection App
      </h1>
      <div className="max-w-xl mx-auto mt-12">
        <label className="flex justify-center w-full h-32 px-12 transition bg-white border-2 border-gray-300 border-dashed rounded-md appearance-none cursor-pointer hover:border-gray-400 focus:outline-none">
          <span className="flex items-center space-x-2">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              className="w-6 h-6 text-gray-600"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
              strokeWidth="2"
            >
              <path
                strokeLinecap="round"
                d="M7 16a4 4 0 01-.88-7.903A5 5 0 1115.9 6L16 6a5 5 0 011 9.9M15 13l-3-3m0 0l-3 3m3-3v12"
              />
            </svg>
            <span className="font-medium text-gray-600">
              Drop files to Attach, or
              <span className="text-blue-600 underline"> browse</span>
            </span>
          </span>
          <input
            type="file"
            name="file_upload"
            className="hidden"
            accept="image/*"
            onChange={onImageChange}
          />
        </label>
      </div>
      <img
        alt="preview"
        src={imgPreview}
        className="mt-10 mx-auto w-[500px] max-h-[600px] shadow-md rounded-2xl"
      />
      <button onClick={onClickProcess} className="button mt-10 mx-auto">
        Process
      </button>
      {loader && <Loader></Loader>}
      {filtersIsActive && (
        <div className="flex flex-row  mt-12 mx-auto">
          <Select
            options={labels}
            value={labelSearch}
            onChange={setLabelSearch}
            placeholder="Label"
            className="w-64"
          />
          <div className="flex flex-col px-4">
            <p className="mx-auto">Min Confidence: {confidence * 100}%</p>
            <input
              type="range"
              name="confidence"
              id="confidence"
              min={0}
              max={1}
              step={0.1}
              className="mx-4"
              onChange={(e) => {
                setConfidence(e.target.value);
              }}
            />
          </div>

          <button onClick={onClickFilter} className="button">
            Filter
          </button>
        </div>
      )}
      {foundMsg && (
        <p className="mx-auto mt-4 font-vietnam font-semibold text-xl">
          {foundMsg}
        </p>
      )}
      {!loader && (
        <img
          alt="result"
          src={`data:image/png;base64,${newImg64}`}
          className="mt-4 mx-auto w-[500px] max-h-[600px] shadow-md rounded-2xl mb-12"
        />
      )}
    </div>
  );
}

export default App;
